30 коротких советов для улучшения Вашей жизни 

1. Занимайтесь физическими упражнениями ежедневно; 
2. Относитесь серьезно к благодарности; 
3. Воспринимайте свою работу, как искусство; 
4. Ожидайте лучшего и готовьтесь к худшему; 
5. Прочтите «Автобиографию Бенджамина Франклина»; 
6. Составляйте план на неделю;
7. Узнайте 5 главных приоритетов в своей жизни;
8. Скажите «нет» отвлекающим моментам; 
9. Пейте больше воды; 
10. Улучшайте свою работу каждый день; 
11. Найдите духовного наставника; 
12. Вставайте в 5 часов утра каждый день; 
13. Ешьте сбалансированную и полезную пищу; 
14. Найдите героев для себя; 
15. Станьте героем для кого- нибудь; 
16. Улыбайтесь незнакомым людям; 
17. Будьте самым этичным человеком из тех, кого знаете; 18. Не соглашайтесь на меньшее, чем совершенство; 
19. Смакуйте простейшие жизненные удовольствия; 
20. Сберегайте 10% своего дохода каждый месяц; 
21. Проводите время в художественных галереях и театрах;
22. Гуляйте в лесу; 
23. Напишите письма благодарности тем, кто помог Вам; 
24. Забудьте тех, кто обидел Вас; 
25. Помните, что лидерство включает влияние и воздействие, но не звания и награды; 
26. Создайте незабываемые моменты с теми, кого любите; 
27. Подружитесь с 5 великими людьми;
28. Станьте потрясающе вежливыми;
29. Отключите кабельное тв; 
30. Продайте свой телевизор;

15 способов стать лучшим в своём деле 

1. Сегодня будь лучше, чем вчера. 
2. Делай то, что тебя вдохновляет. 
3. 10% внимания уделяй проблеме, которая перед тобой стоит, и 90% ее решению. 
4. Делай свою работу на самом высоком уровне. 
5. Хвали других, особенно в те моменты, когда другим хочется похвалы. 
6. Ежедневно тренируйся в своем ремесле, чтобы стать виртуозом. 
7. Упорно работай, а не ищи оправданий. 
8. Учись быстро подниматься после падений. 
9. Выполняй обещания, данные тобой другим и себе. 
10. Проявляй благородство, особенно в трудные моменты. 
11. Всегда старайся превзойти ожидания. 
12. Ежедневно уделяй время восстановлению физических и душевных сил. 
13. Сделай свой домашний уют фундаментом своего успеха. 
14. Занимайся спортом как профессиональный спортсмен. 
15. Вдохновляй других быть лучше, чем они были вчера.
